export type BasePitch = {
  value: string;
};

export type Pitch = {
  playing: number;
  started: boolean;
  originalLength: number;
  instrument: number;
  join?: boolean;
  doubleUp?: boolean;
  current: number[];
} & BasePitch;

export type AudioPitch = {
  audio: string;
  format: string;
} & Pitch;

